import React from 'react';
import {Link} from 'react-router-dom';
import "../App.css";

const Layout = ({children}) => {
    return (
        <div>
            <header className={"header"}>

                <ul>
                    <li>
                        <Link to={"/"}>Home</Link>
                    </li>
                    <li>
                        <Link to={"/sign-in"}>Sign In</Link>
                    </li>
                </ul>
            </header>
            <main className={"container"}>
                {children}
            </main>

        </div>
    );
};

export default Layout;
